INSERT INTO multimedias VALUES(15,'iBoy ',0,'   1 hora, 30 min.',67,'Iglesias nació en San Diego bajo el apellido «Iglecias» ?rebautizado a propósito por su madre después de que el padre se desentendiera de él incluso en el momento del parto?. Sin embargo el actor decidió adoptar la escritura correcta (Iglesias) en su vida diaria. Como el más joven de seis hermanos encontró en la comedia una forma de enfrentar los problemas. A lo largo de su infancia se crio junto a su madre en varias localidades californianas: Riverside Corona Santa Ana Baldwin Park y Compton hasta que finalmente encontró residencia fija en Long Beach');
INSERT INTO multimedias VALUES(16,'Imperial Dreams      ',0,'   1 hora, 27 min.',21,'Norman Gene Norm Macdonald2? (nacido el 17 de octubre de 1959) es un comediante escritor y actor canadiense. Es mejor conocido por sus cinco temporadas en Saturday Night Live que incluyeron sirviendo como presentador de Weekend Update por tres años. Temprano en su carrera escribió para la comedia de situación Roseanne y hizo apariciones en tales programas como The Drew Carey Show y NewsRadio. También protagonizó en The Norm Show desde 1999 hasta 2001. Comedy Central le dio el 83o puesto en su miniserie de cinco partes The 100 Greatest Stand-ups of All Time. Es observado como uno de los invitados favoritos y más frecuentes de Conan OBrien en sus programas de entrevistas');
