INSERT INTO multimedias VALUES(168,'Lucas Brothers: On Drugs    ',2,'   49 min.',31,'Iglesias nació en San Diego bajo el apellido «Iglecias» ?rebautizado a propósito por su madre después de que el padre se desentendiera de él incluso en el momento del parto?. Sin embargo el actor decidió adoptar la escritura correcta (Iglesias) en su vida diaria. Como el más joven de seis hermanos encontró en la comedia una forma de enfrentar los problemas. A lo largo de su infancia se crio junto a su madre en varias localidades californianas: Riverside Corona Santa Ana Baldwin Park y Compton hasta que finalmente encontró residencia fija en Long Beach');
INSERT INTO multimedias VALUES(169,'Vir Das: Abroad Understanding       ',2,'   1 hora, 5 min.',95,'Norman Gene Norm Macdonald2? (nacido el 17 de octubre de 1959) es un comediante escritor y actor canadiense. Es mejor conocido por sus cinco temporadas en Saturday Night Live que incluyeron sirviendo como presentador de Weekend Update por tres años. Temprano en su carrera escribió para la comedia de situación Roseanne y hizo apariciones en tales programas como The Drew Carey Show y NewsRadio. También protagonizó en The Norm Show desde 1999 hasta 2001. Comedy Central le dio el 83o puesto en su miniserie de cinco partes The 100 Greatest Stand-ups of All Time. Es observado como uno de los invitados favoritos y más frecuentes de Conan OBrien en sus programas de entrevistas');
INSERT INTO multimedias VALUES(170,'Maria Bamford: Old Baby     ',1,'   1 hora, 4 min.',65,'Bo nació el 21 de agosto de 1990. Hijo de Scott Burnham propietario de una compañía de construcción y de Patricia enfermera en el colegio Burnham.3?4? Es el pequeño de tres hermanos; ellos están en el segundo y tercer año en las universidades de Cornell y Suffolk law');
INSERT INTO multimedias VALUES(171,'Norm Macdonald: Hitlers Dog, Gossip y Trickery226?  ',1,'   1 hora, 1 min.',4,'Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clásicos canciones de cuna y mitos griegos que estudian en una escuela-internado llamada Ever After High. En algunos casos los libros son escritos por Suzanne Selfors pero la mayoría de ellos suelen ser escritos por Hale ya que originalmente es la autora de la serie. Técnicamente no es una serie de televisión en los Estados Unidos ya que es una serie Web. Sin embargo la serie es transmitida en la televisión de Francia por el canal infantil francés Gulli. Ever After High es considerada apta para todo el público');
INSERT INTO multimedias VALUES(172,'Tracy Morgan: Staying Alive ',1,'   58 min.',1,'Thirla edición de bolsillo alcanzó el número uno en la lista de bestsellers del New York Times en julio de 2011');
INSERT INTO multimedias VALUES(173,'Hasan Minhaj: Homecoming King229?   ',2,'   1 hora, 12 min.',22,'El Sunnyv rivalidades y la delincuencia están al orden del día pero en la que también es posible formar una familia tener amigos y encontrar el amor... siempre y cuando tenga uno claro que la familia le va a hacer la vida imposible el amor le va a amargar la existencia y los amigos acabarán por llevarle a la tumba.');
