INSERT INTO capitulosSeries VALUES(813,117,'    17 Reasons Why: Beyond the Reasons      ','     636 hora, 5 min.','BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack, un caballo antropomorfo que triunfó en los años 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A través de un marco ambientado en el mundo del espectáculo de Hollywood, los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado');
INSERT INTO capitulosSeries VALUES(814,145,'    Rodney King     ','     637 hora, 5 min.','Demetrdiante stand-up y por su programa de televisión en Comedy Central llamado Important Things with Demetri Martin');
INSERT INTO capitulosSeries VALUES(815,57,'     Puss in Book: Trapped in an Epic Tale   ','     638 hora, 5 min.','Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clásicos, canciones de cuna y mitos griegos, que estudian en una escuela-internado, llamada Ever After High. En algunos casos, los libros son escritos por Suzanne Selfors, pero la mayoría de ellos suelen ser escritos por Hale, ya que originalmente es la autora de la serie. Técnicamente no es una serie de televisión en los Estados Unidos, ya que es una serie Web. Sin embargo la serie es transmitida en la televisión de Francia por el canal infantil francés, Gulli. Ever After High es considerada apta para todo el público');
