INSERT INTO capitulosDocumentales VALUES(990,167,'      Michael Boltons Big Sexy Valentines Day Special ','     54 min.','El Sunnyv rivalidades y la delincuencia están al orden del día pero en la que también es posible formar una familia, tener amigos y encontrar el amor... siempre y cuando tenga uno claro que la familia le va a hacer la vida imposible, el amor le va a amargar la existencia y los amigos acabarán por llevarle a la tumba.');
INSERT INTO capitulosDocumentales VALUES(991,115,'      Project Mc2: A Royal Pain       ','     34 min.','Su particular estilo divertido y animado, lo ha convertido en uno de los comediantes más exitosos, con eventos con boletos agotados en todo el mundo, inclusive agotando boletos en Madison Square Garden y el Microsoft Theater. Además, es unos de los comediantes más vistos en YouTube con más de 300 millones de vistas');
INSERT INTO capitulosDocumentales VALUES(992,23,'       18 Reasons Why: Beyond the Reasons      ',' 29 min.','Su particular estilo divertido y animado, lo ha convertido en uno de los comediantes más exitosos, con eventos con boletos agotados en todo el mundo, inclusive agotando boletos en Madison Square Garden y el Microsoft Theater. Además, es unos de los comediantes más vistos en YouTube con más de 300 millones de vistas');
INSERT INTO capitulosDocumentales VALUES(993,60,'       Rodney King     ','     52 min.','Willd-up y por conducir Bill Burrs Monday Morning Podcast. Como actor interpretó a Patrick Kuby en la serie Breaking Bad y protagonizó la sitcom animada F Is for Family. En 2017 la Rolling Stone lo colocó en el número diecisiete de los cincuenta mejores comediantes en vivo de todos los tiempos');
INSERT INTO capitulosDocumentales VALUES(994,85,'       Puss in Book: Trapped in an Epic Tale   ',' 23 min.','Demetrdiante stand-up y por su programa de televisión en Comedy Central llamado Important Things with Demetri Martin');
INSERT INTO capitulosDocumentales VALUES(995,176,'      Buddy Thunderstruck: The Maybe Pile     ',' 50 min.','Willd-up y por conducir Bill Burrs Monday Morning Podcast. Como actor interpretó a Patrick Kuby en la serie Breaking Bad y protagonizó la sitcom animada F Is for Family. En 2017 la Rolling Stone lo colocó en el número diecisiete de los cincuenta mejores comediantes en vivo de todos los tiempos');
INSERT INTO capitulosDocumentales VALUES(996,83,'       Bill Burr: You People Are All the Same  ',' 6 hora, 9 min.','Ha gAllen. Martin volvió a The Daily Show el 22 de marzo de 2006, como el nuevo Corresponsal Juvenil, llamando a su segmento de Noticias Importantes Profesionales con Demetri Martin. En 2007, protagonizó el video musical de Fountains of Wayne, Someone to Love como Seth Shapiro, un personaje de la canción junto a Faryl Millet');
INSERT INTO capitulosDocumentales VALUES(997,78,'       Craig Ferguson: Im Here to Help ','     6 hora, 23 min.','Thirla edición de bolsillo alcanzó el número uno en la lista de bestsellers del New York Times en julio de 2011');
INSERT INTO capitulosDocumentales VALUES(998,56,'       John Hodgman: Ragnarok  ','     6 hora, 7 min.','Antes de meterse en el mundo de la comedia estuvo trabajando en una compañía telefónica de Los Ángeles. Su familia le pidió que siguiera en su puesto para poder mantenerse económicamente, sin embargo decidió dar un paso adelante a pesar de los riesgos que acarrearía su mala situación económica, puesto que acabó perdiendo su casa y el coche');
INSERT INTO capitulosDocumentales VALUES(999,166,'      Mike Birbiglia: My Girlfriends Boyfriend    ',' 6 hora, 15 min.','Un dí consigue acompañarles y juntos se dirigen al imperio de Kublai Khan. Penurias y privaciones marcan el camino hasta que finalmente, tras varios años, logran llegar a Mongolia y a la corte del Gran Khan. Allí se gana el respeto de Kublai, se hace amigo de Chinkin, el hijo de Kublai Khan, quien sufre de epilepsia');
